import React from 'react';

function StockList({stocks}){
	return (
   <ol className="stock-list"> 
   <div className="stocklist-bar">
      <span>Stockname</span>
      <span>StockPrice</span>
      <span>LastUpdatedDate</span>
   </div>
    {
    stocks.map((stockMap,index)=>{
      return  <li className = "stock-item" key={index}>
                  <div className="stock-item">
                  <span>Stockname : {stockMap["stockName"]}</span>
                  <span>{stockMap["price"]}</span>
                  <span>{stockMap["lastUpdatedDate"]}</span>
                </div> 
             </li>
          })
       }
    </ol>
	);
};

export default StockList;
